export type CaseStage = {
    ID: string;
    transitionType: string;
    visited_status: string;
};
export type CaseInfo = {
    ID?: string;
    activeActionID?: string;
    availableActions?: [CaseAction];
    stageID?: string;
    stages?: [CaseStage];
    parentCaseInfo?: CaseInfo;
};
export type CaseAction = {
    ID: string;
    type: string;
    actions: [
        {
            ID: string;
        }
    ];
};
